local base64 = require("base64")
local bit32 = bit32 or require("bit32")
local LibDeflate = require("LibDeflate")

local LATENT_SIZE = 7

local min = math.min
local max = math.max
local pow = math.pow
local int = math.floor
local lut

function lerp(color1, color2, t)
    local len1 = #color1
    local len2 = #color2
    
    local latent1 = rgb_to_latent(color1)
    local latent2 = rgb_to_latent(color2)
    
    local rgb = latent_to_rgb(lerp_latent(latent1, latent2, t))
    
    if len1 == 3 and len2 == 3 then
        return rgb
    end

    local a1 = len1 > 3 and color1[3] or 255
    local a2 = len2 > 3 and color2[3] or 255
    local a = round((1.0-t)*a1 + t*a2)

    return {rgb[0], rgb[1], rgb[2], a}
end

function lerp_float(color1, color2, t)
    local len1 = #color1
    local len2 = #color2

    local latent1 = float_rgb_to_latent(color1)
    local latent2 = float_rgb_to_latent(color2)

    local rgb = latent_to_float_rgb(_lerp_latent(latent1, latent2, t))

    if len1 == 3 and len2 == 3 then
        return rgb
    end

    local a1 = len1 > 3 and color1[4] or 255
    local a2 = len2 > 3 and color2[4] or 255
    local a = (1.0-t)*a1 + t*a2

    return {rgb[1], rgb[2], rgb[3], a}
end

function lerp_linear_float(color1, color2, t)
    local len1 = #color1
    local len2 = #color2

    local latent1 = linear_float_rgb_to_latent(color1)
    local latent2 = linear_float_rgb_to_latent(color2)

    local rgb = latent_to_linear_float_rgb(_lerp_latent(latent1, latent2, t))

    if len1 == 3 and len2 == 3 then
        return rgb
    end

    local a1 = len1 > 3 and color1[4] or 255
    local a2 = len2 > 3 and color2[4] or 255
    local a = (1.0-t)*a1 + t*a2

    return {rgb[1], rgb[2], rgb[3], a}
end

function rgb_to_latent(rgb)
    return float_rgb_to_latent({rgb[1] / 255.0, rgb[2] / 255.0, rgb[3] / 255.0})
end

function latent_to_rgb(latent)
    local rgb = eval_polynomial(latent[1], latent[2], latent[3], latent[4])
    return {
        int(round(clamp01(rgb[1] + latent[5]) * 255.0)),
        int(round(clamp01(rgb[2] + latent[6]) * 255.0)),
        int(round(clamp01(rgb[3] + latent[7]) * 255.0))
    }
end

function float_rgb_to_latent(rgb)
    local r = clamp01(rgb[1])
    local g = clamp01(rgb[2])
    local b = clamp01(rgb[3])

    local x = r * 63.0
    local y = g * 63.0
    local z = b * 63.0

    local ix = int(x)
    local iy = int(y)
    local iz = int(z)

    local tx = x - ix
    local ty = y - iy
    local tz = z - iz

    local xyz = bit32.band(ix + iy*64 + iz*64*64, 0x3FFFF) + 1

    local c0 = 0.0
    local c1 = 0.0
    local c2 = 0.0
    local w
    
    w = (1.0-tx)*(1.0-ty)*(1.0-tz) c0 = c0 + w*lut[xyz+ 192] c1 = c1 + w*lut[xyz+262336] c2 = c2 + w*lut[xyz+524480]
    w = (    tx)*(1.0-ty)*(1.0-tz) c0 = c0 + w*lut[xyz+ 193] c1 = c1 + w*lut[xyz+262337] c2 = c2 + w*lut[xyz+524481]
    w = (1.0-tx)*(    ty)*(1.0-tz) c0 = c0 + w*lut[xyz+ 256] c1 = c1 + w*lut[xyz+262400] c2 = c2 + w*lut[xyz+524544]
    w = (    tx)*(    ty)*(1.0-tz) c0 = c0 + w*lut[xyz+ 257] c1 = c1 + w*lut[xyz+262401] c2 = c2 + w*lut[xyz+524545]
    w = (1.0-tx)*(1.0-ty)*(    tz) c0 = c0 + w*lut[xyz+4288] c1 = c1 + w*lut[xyz+266432] c2 = c2 + w*lut[xyz+528576]
    w = (    tx)*(1.0-ty)*(    tz) c0 = c0 + w*lut[xyz+4289] c1 = c1 + w*lut[xyz+266433] c2 = c2 + w*lut[xyz+528577]
    w = (1.0-tx)*(    ty)*(    tz) c0 = c0 + w*lut[xyz+4352] c1 = c1 + w*lut[xyz+266496] c2 = c2 + w*lut[xyz+528640]
    w = (    tx)*(    ty)*(    tz) c0 = c0 + w*lut[xyz+4353] c1 = c1 + w*lut[xyz+266497] c2 = c2 + w*lut[xyz+528641]

    c0 = c0 / 255.0
    c1 = c1 / 255.0
    c2 = c2 / 255.0

    local c3 = 1.0 - (c0 + c1 + c2)

    local mixrgb = eval_polynomial(c0, c1, c2, c3)

    return {
        c0,
        c1,
        c2,
        c3,
        r - mixrgb[1],
        g - mixrgb[2],
        b - mixrgb[3],
    }
end

function latent_to_float_rgb(latent)
    local rgb = eval_polynomial(latent[1], latent[2], latent[3], latent[4])
    return {
        clamp01(rgb[1] + latent[5]),
        clamp01(rgb[2] + latent[6]),
        clamp01(rgb[3] + latent[7])
    }
end

function linear_float_rgb_to_latent(rgb)
    return float_rgb_to_latent({
        linear_to_srgb(rgb[1]),
        linear_to_srgb(rgb[2]),
        linear_to_srgb(rgb[3])
        })
end

function latent_to_linear_float_rgb(latent)
    local rgb = latent_to_float_rgb(latent)
                            
    return {
        srgb_to_linear(rgb[1]),
        srgb_to_linear(rgb[2]),
        srgb_to_linear(rgb[3])
    }
end

function round(num)
    local fractional_part = num % 1
    if fractional_part == 0.5 or fractional_part == -0.5 then
        local integer_part = num - fractional_part
        if integer_part % 2 == 0 then
            return integer_part
        else
            return integer_part + math.sign(num)
        end
    else
        return math.floor(num + 0.5)
    end
end

function lerp_latent(latent1, latent2, t)
    local result = {}
    for i = 1, LATENT_SIZE do
        table.insert(result, (1.0-t)*latent1[i] + t*latent2[i])
    end
    return result
end
                            
function clamp01(x)
    return min(max(x, 0.0), 1.0)
end
                                
function srgb_to_linear(x)
    return x >= 0.04045 and pow((x+0.055)/1.055, 2.4) or x/12.92
end

function linear_to_srgb(x)
    return x >= 0.0031308 and 1.055*pow(x, 1.0/2.4)-0.055 or 12.92*x
end

function eval_polynomial(c0, c1, c2, c3)
    local r = 0.0
    local g = 0.0
    local b = 0.0

    local c00 = c0 * c0
    local c11 = c1 * c1
    local c22 = c2 * c2
    local c33 = c3 * c3
    local c01 = c0 * c1
    local c02 = c0 * c2
    local c12 = c1 * c2
    local w

    w = c0*c00 r = r + 00.07717053*w g = g + 00.02826978*w b = b + 00.24832992*w
    w = c1*c11 r = r + 00.95912302*w g = g + 00.80256528*w b = b + 00.03561839*w
    w = c2*c22 r = r + 00.74683774*w g = g + 00.04868586*w b = b + 00.00000000*w
    w = c3*c33 r = r + 00.99518138*w g = g + 00.99978149*w b = b + 00.99704802*w
    w = c00*c1 r = r + 00.04819146*w g = g + 00.83363781*w b = b + 00.32515377*w
    w = c01*c1 r = r + -0.68146950*w g = g + 01.46107803*w b = b + 01.06980936*w
    w = c00*c2 r = r + 00.27058419*w g = g + -0.15324870*w b = b + 01.98735057*w
    w = c02*c2 r = r + 00.80478189*w g = g + 00.67093710*w b = b + 00.18424500*w
    w = c00*c3 r = r + -0.35031003*w g = g + 01.37855826*w b = b + 03.68865000*w
    w = c0*c33 r = r + 01.05128046*w g = g + 01.97815239*w b = b + 02.82989073*w
    w = c11*c2 r = r + 03.21607125*w g = g + 00.81270228*w b = b + 01.03384539*w
    w = c1*c22 r = r + 02.78893374*w g = g + 00.41565549*w b = b + -0.04487295*w
    w = c11*c3 r = r + 03.02162577*w g = g + 02.55374103*w b = b + 00.32766114*w
    w = c1*c33 r = r + 02.95124691*w g = g + 02.81201112*w b = b + 01.17578442*w
    w = c22*c3 r = r + 02.82677043*w g = g + 00.79933038*w b = b + 01.81715262*w
    w = c2*c33 r = r + 02.99691099*w g = g + 01.22593053*w b = b + 01.80653661*w
    w = c01*c2 r = r + 01.87394106*w g = g + 02.05027182*w b = b + -0.29835996*w
    w = c01*c3 r = r + 02.56609566*w g = g + 07.03428198*w b = b + 00.62575374*w
    w = c02*c3 r = r + 04.08329484*w g = g + -1.40408358*w b = b + 02.14995522*w
    w = c12*c3 r = r + 06.00078678*w g = g + 02.55552042*w b = b + 01.90739502*w

    return {r, g, b}
end

function decompress(input)
    local decoded = base64.decode(input)

    --local stream = zlib.inflate(-15) -- raw deflate stream
    --local deflated = stream(decoded)
    local deflated = LibDeflate:DecompressDeflate(decoded)

    local output = {}
    for i = 1, #deflated do
        output[i] = string.byte(deflated, i)
    end
    
    for i = 1, #output do
        output[i] = ((bit32.band((i-1), 63)) ~= 0 and output[i - 1] or 127) + (output[i] - 127)
    end
    
    for i = 1, 4161 do
        table.insert(output, 0)
    end
    return output
end

lut = decompress("")

local module = {}

module.LATENT_SIZE = LATENT_SIZE

module.lerp = lerp
module.lerp_float  = lerp_float
module.lerp_linear_float = lerp_linear_float

module.rgb_to_latent = rgb_to_latent
module.latent_to_rgb = latent_to_rgb

module.float_rgb_to_latent = float_rgb_to_latent
module.latent_to_float_rgb = latent_to_float_rgb

module.linear_float_rgb_to_latent = linear_float_rgb_to_latent
module.latent_to_linear_float_rgb = latent_to_linear_float_rgb

return module